// src/components/Main.js
import React from 'react';
import '../styles/Main.css';

const Main = () => (
  <main className="main-section">
    <div id="dot-grid">
      {Array.from({ length: 200 }, (_, i) => (
        <div key={i} className="dot"></div>
      ))}
    </div>
    <div className="main-content">
      <h1>Welcome to the Future of AI-Driven Financial Systems</h1>
      <p>At Autonomy Labs, we are creating autonomous, self-assembling AI models for a new era of finance and industry automation.</p>
    </div>
  </main>
);

export default Main;
